const TableBody = (props) => {
  const body = props.data.map((row, i) => {
    return (
      <tr key={i}>
        <td>{row.id}</td>
        <td>{row.name}</td>
        <td>{row.provider_code}</td>
        <td>{row.status}</td>
        <td>{row.updated_at}</td>
      </tr>
    );
  });
  return <>{body}</>;
};
export default TableBody;
